import React from 'react';
import './styles/Nav.css'
const Nav = () => {
    return (
        <nav className="nav">
            <div>
        <dl className="sidebar_info">
          <dt>Profile</dt>
          <dt>Messages</dt>
          <dt>News</dt>
          <dt>Music</dt>
          <dt>Settings</dt>
        </dl>
        </div>
      </nav>
    )
}

export default Nav;
